import React from 'react';
import './App.css';
import Mobile from './Mobile/Mobile';
import Desktop from './Desktop/Desktop';
import {
  BrowserView,
  MobileView,
  isBrowser,
  isMobile
} from "react-device-detect"; 

// <>
function App() {
  return (
    <div className="main">
      <BrowserView>
        <Desktop />
      </BrowserView>
      <MobileView>
        <Mobile />
      </MobileView>
    </div>
  );
}

export default App;
